import{_ as e,o as a,c as r,a as o}from"./app.2903b8a5.js";const t={},n=o('<h1 id="archeoloog" tabindex="-1"><a class="header-anchor" href="#archeoloog" aria-hidden="true">#</a> Archeoloog</h1><p>Wat krijg je als je geschiedenis combineert met beweging? Juist, archeologie. Dit keer gaan we letterlijk en figuurlijk graven om erachter te komen of er archeoloog in jou leeft. Ga door naar stap 1.</p><h2 id="stap-1" tabindex="-1"><a class="header-anchor" href="#stap-1" aria-hidden="true">#</a> Stap 1</h2><p>Open het rode pakketje en ga door naar stap 2.</p><h2 id="stap-2" tabindex="-1"><a class="header-anchor" href="#stap-2" aria-hidden="true">#</a> Stap 2</h2><p>In het rode pakketje vind je een zilveren blik, open dit blik voorzichtig. Gelukt? Ga door naar stap 3.</p><h2 id="stap-3" tabindex="-1"><a class="header-anchor" href="#stap-3" aria-hidden="true">#</a> Stap 3</h2><p>In het blik vind je de standaard gereedschappen van een archeoloog. Een houten schep en een tweetal kwasten voor het fijne werk. Ga vervolgens door naar stap 4.</p><h2 id="stap-4" tabindex="-1"><a class="header-anchor" href="#stap-4" aria-hidden="true">#</a> Stap 4</h2><p>Ga op zoek naar de kostbare stukken onder de grond, gebruik hiervoor je gereedschappen. Als je voor je gevoel alle stukken hebt gevonden, ga door naar stap 5.</p><h2 id="stap-5" tabindex="-1"><a class="header-anchor" href="#stap-5" aria-hidden="true">#</a> Stap 5</h2><p>3 stukken gevonden? Dit heeft potentie. Niet? Misschien toch verder kijken. Ga door naar de volgende hobby: &#39;mixoloog&#39;.</p>',12),h=[n];function d(i,s){return a(),r("div",null,h)}const c=e(t,[["render",d],["__file","archeoloog.html.vue"]]);export{c as default};
